import React, { Component } from "react";
import './Project.css';

class Project extends Component {
	render() {
    	console.log(this.props.name)
    return (
      <div className="Project">
           <h1>{this.props.name}</h1>

	       <p>{this.props.body}</p>
	  </div>
    );
  }
}

export default Project;
